import base64
import os

# --- PASTE YOUR BASE64 STRING HERE ---
# Ensure it's enclosed in triple quotes (""" or ''') if it spans multiple lines
# or single/double quotes if it's one long line.
base64_string = """""" 

# --- Configuration ---
output_filename = "runpod_output.wav"

# --- Decoding Logic ---
try:
    # Remove potential whitespace/newlines if pasted across multiple lines
    cleaned_base64_string = "".join(base64_string.split())

    if not cleaned_base64_string or cleaned_base64_string == "PASTE_YOUR_LONG_BASE64_STRING_HERE":
        print("Error: Please paste the actual Base64 string into the script.")
    else:
        # Decode the Base64 string into bytes
        audio_bytes = base64.b64decode(cleaned_base64_string)
        
        # Write the bytes to a .wav file
        output_path = os.path.join(os.getcwd(), output_filename) # Save in current dir
        with open(output_path, 'wb') as f:
            f.write(audio_bytes)
            
        print(f"Successfully decoded audio and saved to: {output_path}")

except base64.binascii.Error as e:
    print(f"Error decoding Base64 string: {e}")
    print("Please ensure you copied the entire, correct Base64 string.")
except Exception as e:
    print(f"An unexpected error occurred: {e}") 